import ButtonToolbar from "./components/button-toolbar";
import BottomContent from "./components/bottom-content";


function App() {
  return (
    <BrowserRouter>
        <TopTaskbar/>
        <div className={"container-fluid"} style={{marginTop:"80px"}}>
      <ButtonToolbar/>
      {/*<div className="container-fluid container-fluid2 h-100">*/}
      {/*    <h1>sds</h1>*/}
      {/*</div>*/}
      <BottomContent/>
        </div>
    </BrowserRouter>
  );
}

export default App;
